  type: Method
  source:
    id: ParseRequest
    path: C:\IT\GitHub\SHS\Abatab\src\Roundhouse.cs
    startLine: 30
  assemblies:
  - Abatab
  namespace: Abatab
  summary: "\nDetermines which Abatab Module should get the Command/Action/Option components of the Script Parameter sent from Avatar.\n"
  remarks: "\n* The only component of the Script Parameter sent from Avatar that matters at this point is the AbatabMethod component.\n* Whenever a new Abatab Module is added, logic will need to be added to the switch statement using the following template:\n<pre><code>case &quot;%newmodule-name%&quot;:\n    LogEvent.Trace(abatabSession, Assembly.GetExecutingAssembly().GetName().Name, &quot;[TRACE]&quot;);\n    ModNewModule.Roundhouse.ParseRequest(abatabSession);\n    break;</code></pre>\n"
  example: []
  syntax:
    content: public static void ParseRequest(Session abatabSession)
    parameters:
    - id: abatabSession
      type: AbatabData.Session
      description: Settings and data for this session of Abatab.
    content.vb: Public Shared Sub ParseRequest(abatabSession As Session)
